import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  CircularProgress,
  Paper,
  Divider,
} from "@mui/material";
import CheckIcon from "@mui/icons-material/Check";

const ComparePage = () => {
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);

  const user = JSON.parse(sessionStorage.getItem("user"));
  const userId = user?.id;

  useEffect(() => {
    if (!userId) return;
    axios
      .get(`http://localhost:3030/api/comparison/${userId}`)
      .then((res) => {
        const dto = res.data;
        setCar1(dto.car1);
        setCar2(dto.car2);
      })
      .catch((err) => {
        console.error("KarÅŸÄ±laÅŸtÄ±rma verisi alÄ±namadÄ±:", err);
      })
      .finally(() => setLoading(false));
  }, [userId]);

  const isNumeric = (val) => !isNaN(parseFloat(val)) && isFinite(val);

  const renderFeatureRow = (label, key) => {
    const val1 = car1?.[key];
    const val2 = car2?.[key];
    const isEqual = val1 === val2;

    const compare = () => {
      if (!isNumeric(val1) || !isNumeric(val2)) return [false, false];
      const num1 = parseFloat(val1);
      const num2 = parseFloat(val2);
      if (key === "price" || key === "km") {
        // Daha dÃ¼ÅŸÃ¼k olan daha iyidir
        return [num1 < num2, num2 < num1];
      } else {
        return [num1 > num2, num2 > num1];
      }
    };

    const [better1, better2] = compare();

    const style = (highlight) => ({
      fontWeight: highlight ? "bold" : "normal",
      color: highlight ? "green" : "inherit",
      textAlign: "center",
    });

    return (
      <Grid container spacing={2} alignItems="center" key={key}>
        <Grid item xs={4}>
          <Typography sx={style(better1)}>{val1}</Typography>
        </Grid>
        <Grid item xs={4} textAlign="center">
          <Typography color="text.secondary">{label}</Typography>
          {isEqual && <CheckIcon sx={{ color: "green", ml: 1 }} />}
        </Grid>
        <Grid item xs={4}>
          <Typography sx={style(better2)}>{val2}</Typography>
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2)
    return <Typography m={5}>KarÅŸÄ±laÅŸtÄ±rma bulunamadÄ±.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        ðŸš— AraÃ§ KarÅŸÄ±laÅŸtÄ±rmasÄ±
      </Typography>

      {/* Arabalar Yan Yana */}
      <Grid container spacing={2} justifyContent="center" sx={{ mb: 4 }}>
        {[car1, car2].map((car, index) => (
          <Grid item xs={12} md={5} key={index}>
            <Paper elevation={3}>
              {car.images?.[0] && (
                <Box
                  component="img"
                  src={`data:image/jpeg;base64,${car.images[0].imageBase64}`}
                  alt={`${car.brand} ${car.model}`}
                  sx={{
                    width: "100%",
                    aspectRatio: "16/9",
                    objectFit: "cover",
                  }}
                />
              )}
              <Box p={2} textAlign="center">
                <Typography variant="h6">
                  {car.brand} {car.model}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {car.fuel}
                </Typography>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Divider sx={{ my: 3 }} />

      {/* Ã–zellik KarÅŸÄ±laÅŸtÄ±rmasÄ± */}
      <Paper elevation={2} sx={{ p: 3 }}>
        {renderFeatureRow("Fiyat (â‚º)", "price")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Kilometre", "km")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Model YÄ±lÄ±", "year")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("YakÄ±t TÃ¼rÃ¼", "fuel")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Ä°letiÅŸim", "contact")}
      </Paper>
    </Box>
  );
};

export default ComparePage;
